window.bookSummaryJSON = "<p>To preserve the future, Alex must find the secrets of the past.</p> <p>After a devastating battle, Alex Roth is left with more questions than answers, and—as the Ravener grows more aggressive—he and his companions struggle to learn the truth of Thameland’s Cycle.</p> <p>But—thanks to an old enemy—they do have one lead, though it will take them into the bowels of the darkest Hells.</p> <p>To prepare, Alex will have to reveal who he truly is to the other Heroes of Thameland, and deal with the consequences.</p> <p>On the line are not only truths about Thameland’s endless, bloody cycles…but also the greatest secret of the patron Saint of Alric...the Traveller.</p> <p>Book six of the best-selling series. Continue your fantastical journey into a coming-of-age magic academy fantasy with a weak-to-strong progression into power, deepening mystery, a setting inspired by D&amp;D, detailed world building and magical science, action, comedy, slice-of-life, and GameLit elements.</p>"; 
